import axios from "axios";
import React from "react";
import { useState } from "react/cjs/react.development";

function Login(props) {
  function handleSubmit(e) {
    const [User, setUser] = useState([]);
    e.preventDefault();
    axios.post("https://mm010221.herokuapp.com/user/login").then((res) => {
      setUser(res.data);
    });
    console.log("submitted.");
  }
  return (
    <div>
      <div className="formWrapper w-1/3 mx-auto">
        <form onSubmit={handleSubmit}>
          <label htmlFor="email">
            Email
            <input
              type="text"
              name="email"
              className="w-full border focus:outline-none px-2 rounded-md h-8"
            />
          </label>
          <label htmlFor="password" className="text-gray-600">
            Password
            <input
              type="password"
              name="password"
              className="w-full border focus:outline-none px-2 rounded-md h-8"
            />
          </label>
          <input
            type="submit"
            value="Log In"
            className="px-6 py-2 mt-2 rounded-md bg-red-400 text-white hover:bg-red-800 cursor-pointer"
          />
        </form>
      </div>
    </div>
  );
}

export default Login;
